export default function Navbar({ role, logout }) {
  return (
    <nav className="bg-[color:var(--secondary)] px-6 py-4 flex justify-between">
      <h1 className="text-white font-bold text-xl">FoodDash</h1>

      <div className="flex gap-4 items-center">
        <span className="bg-white px-3 py-1 rounded-full text-sm font-semibold
                         text-[color:var(--secondary)]">
          {role}
        </span>
        <button onClick={logout} className="text-white text-sm">
          Logout
        </button>
      </div>
    </nav>
  );
}
